module.exports = " <mat-card>\r\n <mat-card-title *ngIf=\"showtitle\">Extend Govmeeting</mat-card-title>\r\n\r\n<h3>Re-arrange cards on the dashboard</h3>\r\n\r\nOpen the file: FrontEnd/ClientApp/src/app/dash-main/dash-main.html\r\n<p>\r\nYou can change the position of any of the small cards or large card by\r\nchanging the position of the gm-small-card or gm-large-card elements in this file.\r\n</p>\r\n\r\n<h3> Add a new feature to a new card on the dashboard </h3>\r\n\r\n<ul>\r\n  <li>\r\n    At a terminal prompt, move to the folder: FrontEnd/ClientApp\r\n  </li>\r\n  <li>\r\n    Enter: ng generate component your-feature\r\n  </li>\r\n  <li>\r\n    Add your functionality to the files in : FrontEnd/ClientApp/src/app/your-feature\r\n  </li>\r\n  <li>\r\n    Insert a new gm-small-card or gm-large-card element in dash-main.html.\r\n  </li>\r\n  <li>\r\n    Insert the gm-your-feature element into the content area of the new card element.\r\n  </li>\r\n  <li>\r\n    Modify the icon, iconcolor, title and tooltip input attributes on the card element.\r\n  </li>\r\n  <li>\r\n    If you want the name of the currently selected location and agency in your controller:\r\n    <ul>\r\n      <li>\r\n        Add the location and agency input attributes to your element\r\n      </li>\r\n      <li>\r\n        Add location and agency @Input properties in your controller. (See the other samples on dash-main.html)\r\n      </li>\r\n    </ul>\r\n  </li>\r\n</ul>\r\n\r\n<h3> Add a new Web API's </h3>\r\n\r\n<h3> Add a new table to the database </h3>\r\n\r\n<h3> Add more fields to the database for the logged in user</h3>\r\n\r\n<p>\r\n  Add properties to the class \"ApplicationUser\" in the file BackEnd\\Database\\DatabaseAccess_Lib\\ApplicationUser.\r\n  When the WebApp is restarted, new fields will be automatically generated in the database.\r\n  After these changes are made in development and tested, an SQL change script can then be generated to update\r\n  the production database.\r\n</p>\r\n\r\n<h3> Developer Tips</h3>\r\n\r\n<ul>\r\n  <li>\r\n    Dependency Injection - This is used throughout all projects. It allows components\r\n    and subsystems to be stubbed out easily for develpment and testing.\r\n    For example, in Frontend/ClientApp/src/app/app.module.ts,\r\n    the services that call the Web API's in WebApp are currently replaced\r\n    with stubs using DI. This allow the CLientApp to be developed without running\r\n    WebApp. If you change the property \"_isAspServerRunning\" in this file from false to true,\r\n    ClientApp will then call the Web API's to get data.\r\n  </li>\r\n  <li>\r\n    The log files for WebApp and WorkflowApp are in the folder \"logs\" at the root of the solution.\r\n    The file nlog-all-(date).log contain all the log messages including system.\r\n    The file nlog-own-(date).log contain only the application messages.\r\n  </li>\r\n  <li>\r\n    At the top of many of the component files in ClientApp, a const \"NoLog\" is defined.\r\n    Change its value from true to false to turn on console logging for only that component.\r\n    <br/>\r\n    Log message are written in the form: \"NoLog || console.log(this.ClassName + ...your.message.....\"\r\n    \"this.ClassName\" displays the name of the component's class at the start of the message.\r\n    If we were to put this boilerplate code in a wrapper function, the browser developer tools would always\r\n    display the line number of the wrapper function as the line where the log message occurred.\r\n  </li>\r\n</ul>\r\n\r\n</mat-card>\r\n\r\n\r\n\r\n\r\n"

