module.exports = "<mat-card>\r\n  <mat-card-title *ngIf=\"showtitle\">Workflow</mat-card-title>\r\n\r\n<ol>\r\n  <li>\r\n    <span class=\"L1\"> Individual Registration</span>\r\n    <p>\r\n      During registration, users specify their home location (town, city, village, postal code, etc). Based on their location, the system\r\n      determines each of their governing entities (country, state, county, town/city etc)\r\n  </p>\r\n  </li>\r\n  <li>\r\n    <span class=\"L1\">Government Body Registration</span>\r\n    <p>\r\n      An user may complete the registration for their local governing entities: (town, city, village, county, state, etc).\r\n      When user register for the same location, they will see the data already entered. They\r\n      can vote on the accuracy of any data items and specify alternate values. Votes will accumulate for each data value and the values\r\n      with the most votes become the values that are on the official registration form that is used by the system.\r\n      <a href=\"https://github.com/govmeeting/govmeeting/issues/62\">Github issue #62</a>\r\n    </p>\r\n  </li>\r\n  <li>\r\n    <span class=\"L1\"> Import recordings or transcripts</span>\r\n    <ul>\r\n      <li>\r\n        Download existing online recordings or transcripts on a regular schedule from\r\n        the online locations specified in the Government Body Registration.\r\n      </li>\r\n      <li>\r\n        User upload of recordings or transcripts.\r\n         Occasionally the upload process may require manual steps by a volunteer.\r\n      </li>\r\n      <li>\r\n        Many places neither provide transcripts nor recordings of their meetings.\r\n        Govmeeting will provide a smartphome app that can be used to\r\n        personally record and upload a meeting recording.\r\n        <a href=\"https://github.com/govmeeting/govmeeting/issues/18\">Github issue #18</a>\r\n      </li>\r\n    </ul>\r\n  </li>\r\n  <li>\r\n    <span class=\"L1\">Conversion to text</span>\r\n    <ul>\r\n      <li>\r\n        <span class=\"L2\">Convert transcripts to plain text</span>\r\n        Often existing transcripts are in other formats like PDF. These are converted to plain text.\r\n      </li>\r\n      <li>\r\n        <span class=\"L2\">Convert recordings using speech-to-text</span><br/>\r\n        The following processing is currently being done:\r\n        <ul>\r\n          <li>\r\n            Convert to each of the primary web video formats (mp4, ogg and webm.)\r\n            This enables volunteers to view or hear the recording during the proofreading stage,\r\n            irregardless of the device they are using.\r\n          </li>\r\n          <li>\r\n            Extract and merge the audio tracks.\r\n          </li>\r\n          <li>\r\n            Upload the audio file to the Google Cloud.\r\n          </li>\r\n          <li>\r\n            Call the asynchronous Google Speech API to do auto voice recognition.\r\n          </li>\r\n        </ul>\r\n    </li>\r\n    </ul>\r\n  </li>\r\n  <li>\r\n    <span class=\"L1\"> Further processing of speech-to-text output</span>\r\n    <ul>\r\n      <li>\r\n        <span class=\"L2\">Speaker change recognition</span>\r\n      </li>\r\n      <li>\r\n        <span class=\"L2\">Add speaker identification</span>\r\n      </li>\r\n      <li>\r\n        <span class=\"L2\">Proofread generated text</span><br/>\r\n        The following processing is currently being done:\r\n        <ul>\r\n          <li> Split the video, audio and trancript files into 3 minute work segments.</li>\r\n          <li> Provide a user friendly interface for quickly correcting errors.\r\n            See: <a [routerLink]=\"['/fixasr']\">Proofread</a>\r\n          </li>\r\n        </ul>\r\n      </li>\r\n    </ul>\r\n  </li>\r\n  <li>\r\n    <span class=\"L1\">Add section labels</span>\r\n    <ul>\r\n      <li> Extract information such as speaker and section names. * </li>\r\n      <li> Put the information into a JSON format for further processing. * </li>\r\n    </ul>\r\n\r\n  </li>\r\n  <li>\r\n    <span class=\"L1\"> Add issue tags</span>\r\n  </li>\r\n  <li>\r\n    <span class=\"L1\">Populate database with final output</span>\r\n  </li>\r\n  <li>\r\n    <span class=\"L1\">Data is now available for use</span>\r\n    <ul>\r\n      <li>\r\n        A browe-able & search-able transcript is now available\r\n      </li>\r\n      <li>\r\n        A summary of the issues discussed at the meeting is sent to those requesting it.\r\n      </li>\r\n      <li>\r\n        Alerts are sent on specific issues to those requesting it.\r\n      </li>\r\n    </ul>\r\n  </li>\r\n  <li>\r\n    <span class=\"L1\">Virtual meeting is arranged.</span>\r\n    <ul>\r\n      <li>\r\n        An agenda is created based on issues at the real meeting.\r\n      </li>\r\n      <li>\r\n        Invitatations are sent to community members. Included are requests for possible additional agenda items.\r\n      </li>\r\n      <li>\r\n        When responses are received, a ballot is sent to those who wil attend. On this ballot, members can vote on whether\r\n        to include any of the suggested new agenda items.\r\n      </li>\r\n      <li>\r\n        Within a few days, a virtual meeting is held.\r\n      </li>\r\n  </ul>\r\n  </li>\r\n</ol>\r\n\r\n<p>\r\n  For a detailed functional design, see: <a href=\"https://github.com/govmeeting/govmeeting/wiki/functional-design\">Funtional Design on Github.</a><br>\r\n  For a detailed system design, see: <a href=\"https://github.com/govmeeting/govmeeting/wiki/system-design\">System Design on Github.</a>\r\n</p>\r\n\r\n</mat-card>\r\n\r\n"

