"agency\">\r\n      </gm-meetings>\r\n    </gm-small-card>\r\n\r\n    <gm-small-card\r\n      icon=\"far fa-newspaper\"\r\n      iconcolor=\"color-photo-icon\"\r\n      title={{newsTitle}}\r\n      tooltip=\"Displays current news.\">\r\n      <gm-news\r\n      [location]=\"location\"\r\n      [agency]=\"agency\">\r\n    </gm-news\r\n        >\r\n    </gm-small-card>\r\n\r\n  </gm-small-cards>\r\n\r\n  <gm-large-cards>\r\n\r\n    <gm-large-card\r\n      icon=\"fas fa-exclamation\"\r\n      iconcolor=\"color-calendar-icon\"\r\n      title={{fixasrTitle}}\r\n      tooltip=\"Proofread speech recognition text.\">\r\n      <gm-fixasr></gm-fixasr>\r\n    </gm-large-card>\r\n\r\n    <gm-large-card\r\n      icon=\"fas fa-exclamation\"\r\n      iconcolor=\"color-calendar-icon\"\r\n      title={{addtagsTitle}}\r\n      tooltip=\"Add tags to text.\">\r\n      <gm-addtags></gm-addtags>\r\n    </gm-large-card>\r\n\r\n    <gm-large-card\r\n      icon=\"fas fa-exclamation\"\r\n      iconcolor=\"color-calendar-icon\"\r\n      title={{viewMeetingTitle}}\r\n      tooltip=\"Browse or search latest meeting.\">\r\n      <gm-viewmeeting></gm-viewmeeting>\r\n    </gm-large-card>\r\n\r\n    <gm-large-card\r\n      icon=\"fas fa-exclamation\"\r\n      iconcolor=\"color-calendar-icon\"\r\n      title={{issuesTitle}}\r\n      tooltip=\"Displays information about current issues.\">\r\n     Recent<br/>\r\n     Most active<br/>\r\n     Those I am following<br/>\r\n    </gm-large-card>\r\n\r\n    <gm-large-card\r\n      icon=\"fas fa-user-friends\"\r\n      iconcolor=\"color-calendar-icon\"\r\n      title={{officialsTitle}}\r\n      tooltip=\"Displays information about current governing officials.\">\r\n    </gm-large-card>\r\n\r\n    <gm-large-card\r\n      icon=\"far fa-calendar-check\"\r\n      iconcolor=\"color-mail-icon\"\r\n      title={{virtualMeetingTitle}}\r\n      tooltip=\"Displays information about past and future virtual meetings.\">\r\n      <gm-virtual-meeting></gm-virtual-meeting>\r\n    </gm-large-card>\r\n\r\n    <gm-large-card\r\n      icon=\"fas fa-comments\"\r\n      iconcolor=\"color-mail-icon\"\r\n      title={{chatTitle}}\r\n      tooltip=\"This is a chat window for discussing current issue.\">\r\n      <!-- <gm-chat></gm-chat> -->\r\n      Temporarily removed gm=chat elementin dash-main.html\r\n    </gm-large-card>\r\n\r\n    <gm-large-card\r\n      icon=\"far fa-calendar-check\"\r\n      iconcolor=\"color-calendar-icon\"\r\n      title={{chartsTitle}}\r\n      tooltip=\"Displays information about issues, bills, officials, etc, in graphical form.\">\r\n      <!-- <gm-pie-chart></gm-pie-chart> -->\r\n      <!-- <gm-bar-chart></gm-bar-chart> -->\r\n      <!-- <gm-gauge></gm-gauge> -->\r\n    </gm-large-card>\r\n\r\n  </gm-large-cards>\r\n\r\n\r\n</main>\r\n"

